import React from 'react'
import Dashboard from './pages/Dashboard'
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>


     <BrowserRouter>

        <Routes>
          <Route exact path="/users"  element={<Dashboard />} />
        </Routes>

      </BrowserRouter>


    </div>
  )
}

export default App
